script: |
  super -f text -I q6743.spq | sort > q6743.out

inputs:
  - name: q6743.spq
    data: |
      SELECT - ( + col1 ) + + + ( + col0 ) FROM tab0 (FORMAT parquet) WHERE ( - col2 * + + col1 NOT BETWEEN col2 + + + col2 AND + - col0 * ( + col1 ) );
  - name: tab0

outputs:
  - name: q6743.out
    data: |
      -66
      66
      96
